import React, {Component} from 'react';
import './App.css';
import List from '../components/list/list';

class App extends Component{
  state = {
    tasks: [
      {key: 0, status: "done", task:"primeira do dia"},
      {key: 1, status: "to do", task:"segunda do dia"},
    ]
  }

  render(){
    return(
      <div className='App'>
        <List
          tasks = {this.state.tasks}
        />
      </div>
    )
  }
}

export default App;
